import React from 'react'
import { Card } from './Card'
import './css/projects.css'
export const Projects = () => {
  const url='https://blog-frontend.envato.com/cdn-cgi/image/width=2560,quality=75,format=auto/uploads/sites/2/2022/04/E-commerce-App-JPG-File-scaled.jpg'
  const dataEcommerce = 'My personal blog page build with Next.js and Tailwind Css which takes the content from makdown files and renders it using Next.js. Supports dark mode and easy to write blogs using markdown.';
  const dataHospital = 'Hospital Management System, powered by Spring REST APIs, streamlines healthcare operations for hospitals, physicians, and nurses. It enhances patient care and administrative efficiency with Java 8, Spring Boot, MySQL, and modern tech. While it lacks a frontend, it demonstrates my software development and healthcare management capabilities';
  return (
    <>
      <div className='projecthead '>
        <h1 className='texttitle'>My Recent <span className='highlight'>Projects</span></h1>
        </div>

        <div className='cards'>
          <Card title='Hospital Management System' img={url} data={dataHospital}/>       
          <Card title='E-commerce Website' img={url} data={dataEcommerce}/>       
          <Card title='Student Management System' img={url} data={dataEcommerce}/>       


        </div>
    </>
  )
}
